import React from 'react';
import cate from './cate.css'
function Category(props){
  return (
    <>
   
          <div className='cat'>
                <p className='travels'>{props.data}</p>
                <p className='dates'> / Auguest 21/2017</p>
            </div>
     
    </>
  )
}

export default Category;
